candidate_text:
 Some key events that shaped the movement include: 

The Montgomery Bus Boycott (1955-1956), where Rosa Parks refused to give up her seat on a bus; 
The March on Washington (1963), where Martin Luther King Jr delivered his famous "I Have a Dream" speech; 
The Selma to Montgomery Marches (1965), where protesters marched for three days to demand voting rights;
And the landmark Supreme Court decision in Brown v Board of Education (1954), which declared segregation in public schools unconstitutional.
